import { Container, Navbar } from "react-bootstrap";

const Header: React.FC = () => {
  return (
    <>
      <Container>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand href="#home">My App</Navbar.Brand>
        </Navbar>
      </Container>
    </>
  );
};

export default Header;
